// SPDX-License-Identifier: MIT

// This contract is for the users. They should be allowed to upload a file through either IPFS or filecoin or one of the testnets for distributed storage. They should also be allowed to 
// retrieve a file either using a hash of their uploaded file, viewing your own uploads, viewing uploads from your organization. A UI idea is to have a directory like structure similar to
// sagemaker. They should be allowed to use cloud computing capabilities through Iexec testnet (might need to be a seperate contract since testnet is different).

pragma solidity >=0.6.0 <0.9.0;
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";


//create own token and charge people for uploading and downloading, you should be paying those that own the node.
// choose how much to give each user when they first choose account.
// if we want to set limits on users we can create an erc721 token

contract UploadDownload is Ownable,ERC20 {
    address private _owner;
    uint256 public tokenCounter;
    uint256 public _feeUpload;
    uint256 public _feeDownload;
    address[] private _sellers;
    bytes public vendorName;
    mapping(address => bytes) public addresstoVendor;
    constructor(uint256 feeUpload, uint256 feeDownload, uint256 totalSupplyChosen) 

    ERC20("Taxes", "GOV")
    {
        address msgSender = _msgSender();
        _owner = msgSender;
        _feeUpload = feeUpload;
        _feeDownload =feeDownload;
        _mint(msg.sender,totalSupplyChosen);

    }
    modifier sendtoSeller(address Recepient){ //should only be able to upload to a real seller
        require(addresstoVendor[Recepient].length != 0,"Not a seller");
        _;

    }

    modifier downloadfromSeller(address Recepient, string memory companyname){ //should only be able to download from the specific seller they uploaded to
        require(addresstoVendor[Recepient].length != 0,"Not a seller");
        vendorName=bytes(companyname);
        require(keccak256(addresstoVendor[Recepient])==keccak256(vendorName), "Wrong seller");
        _;

    }


    function changetotalSupply(uint256 addedtotalSupply) public onlyOwner(){
        _mint(msg.sender,addedtotalSupply);

    }
    // only owner can add money to a user

    function addmoneytoUser(uint256 moneyAdded, address Recepient) public onlyOwner(){
        transfer(Recepient, moneyAdded);
    }

    //initially no sellers, must add sellers first, this is because each user should be given access to certain sellers only.
    function AddSeller(address newseller, string memory _vendorName) public onlyOwner() {
        _sellers.push(newseller);
        vendorName=bytes(_vendorName);
        addresstoVendor[newseller]=vendorName;
    }
    function DownloadApproved(address Recepient, string memory companyname) public downloadfromSeller(Recepient, companyname) {
        transfer(Recepient, _feeDownload);    
    }

    function UploadApproved(address Recepient) public sendtoSeller(Recepient) returns (string memory) {
        transfer(Recepient, _feeUpload);
        return(string(addresstoVendor[Recepient]));
    }
    // funcrions will allow user to upload a file (for now it will just be one example file provided). They will choose to run the file, they will then retrieve information on the cost
// and what user ran it, they will then pay the user and after they pay they will get their result from their run. From here we will move on to the front end. Can limit which sellers you sendto.

    function payUserwithgpu(address Recepient, uint256 gpuCost) public returns (bool){
        require(msg.sender.balance>=gpuCost);
        transfer(Recepient,gpuCost);
        return(true);


    }

}
